  input: TEXT,F3XA,,"Per your letter of March 26, 2003, we are hereby amending our
    7/1/02-9/30/02 Quarterly Report which incorrectly reported contributions of $1,000
    on July 30, 2002 to Stenholm for Congress Committee and $2,000 on July 30, 2002
    to Boucher for Congress Committee.   Since the funds could not be redesignated
    for the correct election within the 60 day period allowed after the treasurer's
    receipt,  we requested  a refund from each of these committees on April 10, 2003
    (a copy of these letters were sent to the FEC).   These funds will be redeposited
    into the Archpac account and, in accordance with your instructions, will be reflected
    on the next scheduled report which is due July 15, 2003."
